mod cards;
mod game;

contract CardGame {
    use dep::aztec::protocol_types::{abis::function_selector::FunctionSelector, address::AztecAddress, constants::MAX_NOTES_PER_PAGE};
    use dep::aztec::{context::Context, hash::pedersen_hash, state_vars::{Map, PublicMutable}};

    use dep::value_note::{balance_utils, value_note::{ValueNote, VALUE_NOTE_LEN}};

    use dep::aztec::note::note_header::NoteHeader;

    use crate::cards::{PACK_CARDS, Deck, Card, get_pack_cards, compute_deck_strength};
    use crate::game::{NUMBER_OF_PLAYERS, NUMBER_OF_CARDS_DECK, PLAYABLE_CARDS, PlayerEntry, Game, GAME_SERIALIZED_LEN};

    struct Storage {
        collections: Map<AztecAddress, Deck>,
        game_decks: Map<Field, Map<AztecAddress, Deck>>,
        games: Map<Field, PublicMutable<Game>>,
    }

    #[aztec(private)]
    fn buy_pack(seed: Field // The randomness used to generate the cards. Passed in for now.
    ) {
        let buyer = context.msg_sender();
        let mut cards = get_pack_cards(seed, buyer, &mut context);

        let mut collection = storage.collections.at(buyer);
        let _inserted_cards = collection.add_cards(cards, buyer);
    }

    #[aztec(private)]
    fn join_game(game: u32, cards_fields: [Field; 2]) {
        let cards = cards_fields.map(|card_field| Card::from_field(card_field));

        let player = context.msg_sender();

        let mut collection = storage.collections.at(player);
        collection.remove_cards(cards, player);
        let mut game_deck = storage.game_decks.at(game as Field).at(player);
        let _added_to_game_deck = game_deck.add_cards(cards, player);
        let selector = FunctionSelector::from_signature("on_game_joined(u32,(Field),u32)");
        let strength = compute_deck_strength(cards);
        context.call_public_function(
            context.this_address(),
            selector,
            [game as Field, player.to_field(), strength]
        );
    }

    #[aztec(public)]
    #[aztec(internal)]
    fn on_game_joined(game: u32, player: AztecAddress, deck_strength: u32) {
        let game_storage = storage.games.at(game as Field);

        let mut game_data = game_storage.read();
        assert(game_data.add_player(PlayerEntry { address: player, deck_strength, points: 0 }), "Game full");

        game_storage.write(game_data);
    }

    #[aztec(public)]
    fn start_game(game: u32) {
        let game_storage = storage.games.at(game as Field);

        let mut game_data = game_storage.read();
        game_data.start_game();
        game_storage.write(game_data);
    }

    #[aztec(private)]
    fn play_card(game: u32, card: Card) {
        let player = context.msg_sender();

        let mut game_deck = storage.game_decks.at(game as Field).at(player);
        game_deck.remove_cards([card], player);

        let selector = FunctionSelector::from_signature("on_card_played(u32,(Field),Field)");
        // docs:start:call_public_function
        context.call_public_function(
            context.this_address(),
            selector,
            [game as Field, player.to_field(), card.to_field()]
        );
        // docs:end:call_public_function
    }

    #[aztec(public)]
    #[aztec(internal)]
    fn on_card_played(game: u32, player: AztecAddress, card_as_field: Field) {
        let game_storage = storage.games.at(game as Field);

        let mut game_data = game_storage.read();

        let card = Card::from_field(card_as_field);
        let current_player = game_data.current_player();
        assert(current_player.address.eq(player), "Not your turn");
        game_data.play_card(card);

        game_storage.write(game_data);
    }

    #[aztec(private)]
    fn claim_cards(game: u32, cards_fields: [Field; PLAYABLE_CARDS]) {
        let player = context.msg_sender();
        let cards = cards_fields.map(|card_field| Card::from_field(card_field));

        let mut collection = storage.collections.at(player);
        let _inserted_cards = collection.add_cards(cards, player);

        let selector = FunctionSelector::from_signature("on_cards_claimed(u32,(Field),Field)");
        context.call_public_function(
            context.this_address(),
            selector,
            [game as Field, player.to_field(), pedersen_hash(cards_fields, 0)]
        );
    }

    #[aztec(public)]
    #[aztec(internal)]
    fn on_cards_claimed(game: u32, player: AztecAddress, cards_hash: Field) {
        let game_storage = storage.games.at(game as Field);
        let mut game_data = game_storage.read();

        assert(!game_data.claimed, "Already claimed");
        game_data.claimed = true;

        assert_eq(cards_hash, pedersen_hash(game_data.rounds_cards.map(|card: Card| card.to_field()), 0));

        let winner = game_data.winner();
        assert(player.eq(winner.address), "Not the winner");

        game_storage.write(game_data);
    }

    unconstrained fn view_collection_cards(owner: AztecAddress, offset: u32) -> pub [Option<Card>; MAX_NOTES_PER_PAGE] {
        let collection = storage.collections.at(owner);

        collection.view_cards(offset)
    }

    unconstrained fn view_game_cards(game: u32, player: AztecAddress, offset: u32) -> pub [Option<Card>; MAX_NOTES_PER_PAGE] {
        let game_deck = storage.game_decks.at(game as Field).at(player);

        game_deck.view_cards(offset)
    }

    unconstrained fn view_game(game: u32) -> pub Game {
        storage.games.at(game as Field).read()
    }
}

244.source:
use dep::aztec::protocol_types::{address::AztecAddress, traits::{Serialize, Deserialize}};
use crate::cards::Card;

global NUMBER_OF_PLAYERS = 2;
global NUMBER_OF_CARDS_DECK = 2;

struct PlayerEntry {
    address: AztecAddress,
    deck_strength: u32,
    points: u64,
}

impl PlayerEntry {
    pub fn is_initialized(self) -> bool {
        !self.address.is_zero()
    }
}

global PLAYER_SERIALIZED_LEN: Field = 3;

impl Deserialize<PLAYER_SERIALIZED_LEN> for PlayerEntry {
    fn deserialize(fields: [Field; PLAYER_SERIALIZED_LEN]) -> PlayerEntry {
        let address = AztecAddress::from_field(fields[0]);
        let deck_strength = fields[1] as u32;
        let points = fields[2] as u64;

        PlayerEntry {
            address,
            deck_strength,
            points
        }
    }
}

global PLAYABLE_CARDS = 4;

struct Game {
    players: [PlayerEntry; NUMBER_OF_PLAYERS],
    rounds_cards: [Card; PLAYABLE_CARDS],
    started: bool,
    finished: bool,
    claimed: bool,
    current_player: u32,
    current_round: u32,
}

global GAME_SERIALIZED_LEN: Field = 15;

impl Serialize<GAME_SERIALIZED_LEN> for Game {
    fn serialize(game: Game) -> [Field; GAME_SERIALIZED_LEN] {
        [
            game.players[0].address.to_field(),
            game.players[0].deck_strength as Field,
            game.players[0].points as Field,
            game.players[1].address.to_field(),
            game.players[1].deck_strength as Field,
            game.players[1].points as Field,
            game.rounds_cards[0].to_field(),
            game.rounds_cards[1].to_field(),
            game.rounds_cards[2].to_field(),
            game.rounds_cards[3].to_field(),
            game.started as Field,
            game.finished as Field,
            game.claimed as Field,
            game.current_player as Field,
            game.current_round as Field
        ]
    }
}

impl Deserialize<GAME_SERIALIZED_LEN> for Game {
    fn deserialize(fields: [Field; GAME_SERIALIZED_LEN]) -> Game {
        let player1 = PlayerEntry::deserialize([fields[0], fields[1], fields[2]]);
        let player2 = PlayerEntry::deserialize([fields[3], fields[4], fields[5]]);

        let players = [player1, player2];
        let rounds_cards = [
            Card::from_field(fields[6]), Card::from_field(fields[7]),
            Card::from_field(fields[8]), Card::from_field(fields[9])
        ];
        Game {
            players,
            rounds_cards,
            started: fields[10] as bool,
            finished: fields[11] as bool,
            claimed: fields[12] as bool,
            current_player: fields[13] as u32,
            current_round: fields[14] as u32
        }
    }
}

impl Game {
    pub fn add_player(&mut self, player_entry: PlayerEntry) -> bool {
        let mut added = false;

        for i in 0..NUMBER_OF_PLAYERS {
            let entry = self.players[i];
            if entry.is_initialized() {
                assert(!entry.address.eq(player_entry.address), "Player already in game");
            } else if !added {
                self.players[i] = player_entry;
                added = true;
            }
        }

        added
    }

    pub fn start_game(&mut self) {
        assert(!self.started, "Game already started");
        for i in 0..NUMBER_OF_PLAYERS {
            let entry = self.players[i];
            assert(entry.is_initialized(), "Game not full");
        }
        let sorted_by_deck_strength = self.players.sort_via(|a: PlayerEntry, b: PlayerEntry| a.deck_strength < b.deck_strength);
        self.players = sorted_by_deck_strength;
        self.started = true;
    }

    pub fn current_player(self) -> PlayerEntry {
        assert(self.started, "Game not started");
        assert(!self.finished, "Game finished");
        self.players[self.current_player]
    }

    pub fn winner(self) -> PlayerEntry {
        assert(self.finished, "Game not finished");
        let mut winner = self.players[0];
        for i in 1..NUMBER_OF_PLAYERS {
            let entry = self.players[i];
            if entry.points > winner.points {
                winner = entry;
            }
        }
        winner
    }

    pub fn play_card(&mut self, card: Card) {
        assert(self.started, "Game not started");
        assert(!self.finished, "Game finished");

        let round_offset = self.current_round * NUMBER_OF_PLAYERS;

        self.rounds_cards[round_offset + self.current_player] = card;
        self.current_player = (self.current_player + 1) % NUMBER_OF_PLAYERS;

        if self.current_player == 0 {
            self._finish_round();
        }
    }

    fn _finish_round(&mut self) {
        let round_offset = self.current_round * NUMBER_OF_PLAYERS;
        self.current_round += 1;

        let mut winner_index = 0;
        let mut winner_strength = 0;
        let mut round_points = 0;

        for i in 0..NUMBER_OF_PLAYERS {
            let card = self.rounds_cards[round_offset + i];
            round_points += (card.points as u64);
            if card.strength > winner_strength {
                winner_strength = card.strength;
                winner_index = i;
            }
        }

        self.players[winner_index].points += round_points;
        if self.current_round == NUMBER_OF_CARDS_DECK {
            self.finished = true;
        }
    }
}
